import React from 'react';
import styled from 'styled-components';

const BlockTitle = styled("h3")`
  font-weight: 600;
  font-size: 20px;
  line-height: 27px;
  color: #363636;
  margin: 0px 0px;
`;

const BlockContent = styled("p")`
  font-style: normal;
  font-weight: normal;
  font-size: 16px;
  line-height: 22px;
  text-align: center;
  color: #363636;
  margin-top: 20px;
`;

export {BlockContent, BlockTitle}
